import React, {Component} from 'react';

import './polyfill';
import Explosion from './explosion';
import './styles.scss';
import SideSpotImage from "../SideSpotImage/component";
import PropTypes from "prop-types";

const explosions = {
    A: 'data:audio/mp3;base64, ',
    B: 'data:audio/mp3;base64, ',
    C: 'data:audio/mp3;base64, ',
    M: 'data:audio/mp3;base64, ',
    X: 'data:audio/mp3;base64, ',
};

/**
 * This is the component responsible for the "spots" on the side of the suns
 * face that appear all over and then explode when the reach full size.
 *
 * @author Oliver Lillie
 */
export default class SideSpot extends Component {
    canvas = React.createRef();

    static propTypes = {
        /** The day tick callback. **/
        onDayTick: PropTypes.func.isRequired,
        /** The year to start the count up with. **/
        startingYear: PropTypes.number.isRequired,
    };

    constructor(props) {
        super(props);

        this.state = {
            countUpStarted: false,
            animationStarted: false,
            canvasContext: null,
            animationRequestId: null,
            windowResize: null,
            timeline:[],
            activeSpots:[],
            currentYear:props.startingYear,
            lastMonth:null,
            loadedYear:null,
            activeDate:new Date(props.startingYear, 0, 1),
            intervalId:null,
            mostCommonFlareType:null,
            flareClassTypes:{},
            verboseFlareClassTypes:{},
            mostActiveRegion:null,
            regions:{},
        };

        this.bindEventHandlers();

        this.explosions = [];
    }

    /**
     * Sets up the initial year fetch but don't start it yet because the browser
     * has to have user interaction before the audio can play.
     *
     * @author Oliver Lillie
     */
    componentDidMount() {
        this.fetchYear(this.props.startingYear);
        this.attachWindowClickStartCountUpEvent();
    }

    /**
     * Removes a window resize event listener when the component is unmounted
     * as the explosion canvas requires constance resizing to fit the window.
     *
     * @see removeWindowResizeEventListener
     * @author Oliver Lillie
     */
    componentWillUnmount() {
        this.removeWindowResizeEventListener();
    }

    /**
     * Attaches an event to the window to start the yearcount up. This is done
     * in order to allow the browser to play the sounds. Without the user
     * interacting with the browser then the browser will not play the sounds.
     *
     * @author Oliver Lillie
     */
    attachWindowClickStartCountUpEvent() {
        window.addEventListener('click', this.startYearCount);
    }

    /**
     * Removes the window click handler to only allow the event to fire once.
     * 
     * @author Oliver Lillie
     */
    removeWindowClickStartCountUpEvent() {
        window.removeEventListener('click', this.startYearCount);
    }

    /**
     * Removes a window resize event listener when the component is unmounted
     * as the explosion canvas requires constance resizing to fit the window.
     *
     * @author Oliver Lillie
     */
    removeWindowResizeEventListener() {
        if(this.state.windowResize) {
            window.removeEventListener('resize', this.updateCanvasSizeToWindowDimensions);
            this.setState({
                windowResize: null,
            });
        }
    }

    /**
     * Binds the event handles for component.
     *
     * @author Oliver Lillie
     */
    bindEventHandlers() {
        this.startYearCount = this.startYearCount.bind(this);
        this.handleBangBang = this.handleBangBang.bind(this);
        this.updateCanvasSizeToWindowDimensions = this.updateCanvasSizeToWindowDimensions.bind(this);
    }

    /**
     * Fetches a given years data from the API server.
     *
     * A promise is returned that is resolved when the new years timeline data
     * has been set into the components state.
     *
     * @author Oliver Lillie
     * @param {number} year
     * @return {Promise<any>}
     */
    fetchYear(year) {
        return new Promise((resolve) => {
            this.setState({
                loadedYear: year
            },() => {
                fetch('/spots?year=' + year)
                    .then((response) => response.json())
                    .then((json) => {
                            this.setState({
                                loadedYear: year,
                                timeline: this.state.timeline.concat(Object.values(json.data.timeline) || []),
                            }, resolve);
                        }
                    );
            })
        })
    }

    /**
     * Returns the number of days the given date is from the currently active
     * date within the state.
     *
     * @author Oliver Lillie
     * @param {Date} date
     * @return {number}
     */
    getDaysFromActiveDate(date) {
        if(new Date(date) < this.state.activeDate) {
            return -1;
        }
        return Math.round(Math.abs((this.state.activeDate.getTime() - (new Date(date)).getTime())/86400000));
    }

    /**
     * Returns the SideSpotImage components if they are currently active within
     * the next 10 days. The 10 days is actually irrelevant to any solar flares
     * it's just the amount of time that is used to zoom in the spots.
     *
     * @author Oliver Lillie
     * @param {string} classType The class type of the flar group to created.
     * @return {*}
     * @private
     */
    _getDerivedClassSpots(classType) {
        return this.getFlaresOfClass(classType)
            .map((flare, index) => {
                if(this.state.activeSpots.indexOf(flare.id) === -1) {
                    return null;
                }

                return (
                    <SideSpotImage
                         key={flare.id}
                         flare={flare}
                         classType={classType}
                         daysAwayFromBangBang={this.getDaysFromActiveDate(flare.date)}
                         onBangBang={(target) => this.handleBangBang(target, flare)}
                    />
                )
            });
    }

    /**
     * Returns a list of flares specific to a particular class type.
     *
     * @author Oliver Lillie
     * @param {string} classType
     * @return {Object[]}
     */
    getFlaresOfClass(classType) {
        return Object.values(this.state.timeline).map((flares) => {
            return Object.values(flares).filter((flare) => flare.classType === classType);
        }).flat();
    }

    /**
     * Returns all the X type flares as SideSpotImage components.
     *
     * @author Oliver Lillie
     * @see getFlaresOfClass
     * @return {SideSpotImage[]}
     */
    getDerivedXClassSpots() {
        return this._getDerivedClassSpots('X');
    }

    /**
     * Returns all the M type flares as SideSpotImage components.
     *
     * @author Oliver Lillie
     * @see getFlaresOfClass
     * @return {SideSpotImage[]}
     */
    getDerivedMClassSpots() {
        return this._getDerivedClassSpots('M');
    }

    /**
     * Returns all the C type flares as SideSpotImage components.
     *
     * @author Oliver Lillie
     * @see getFlaresOfClass
     * @return {SideSpotImage[]}
     */
    getDerivedCClassSpots() {
        return this._getDerivedClassSpots('C');
    }

    /**
     * Returns all the B type flares as SideSpotImage components.
     *
     * @author Oliver Lillie
     * @see getFlaresOfClass
     * @return {SideSpotImage[]}
     */
    getDerivedBClassSpots() {
        return this._getDerivedClassSpots('B');
    }

    /**
     * Returns all the A type flares as SideSpotImage components.
     *
     * @author Oliver Lillie
     * @see getFlaresOfClass
     * @return {SideSpotImage[]}
     */
    getDerivedAClassSpots() {
        return this._getDerivedClassSpots('A');
    }

    /**
     * Determines if we are loading next year or not year, it will load when the
     * current day ticker gets to september in order to ensure that the next
     * years data has enough time to be preloaded before the ticker reaches it.
     *
     * @author Oliver Lillie
     */
    loadNextYearIfRequired() {
        if(this.state.activeDate.getMonth() >= 9 && this.state.activeDate.getFullYear() === this.state.loadedYear) {
            const nextYear = this.state.activeDate.getFullYear() + 1;
            if(nextYear <= (new Date()).getFullYear()) {
                this.fetchYear(nextYear);
            }
        }
    }

    /**
     * Returs a list of flare ids that are upcoming in the next 11 days.
     *
     * Note that it is 11 days and not 10, that is in order to force the spot
     * into the dom before we want to animate it so that on next tick a css
     * class can be removed in order to transition it in correctly.
     *
     * @author Oliver Lillie
     * @return {String[]}
     */
    getUpcomingFlareIds() {
        return Object.values(this.state.timeline).flat()
            .filter((flare) => {
                // return true;
                const days = this.getDaysFromActiveDate(flare.date);
                return days >= 0 && days <= 11;
            })
            .map((flare) => flare.id);
    }

    /**
     * Clears up timeline items that have already been shown in order to reduce
     * memory load. The processed is debounced so that it only occurs once every
     * time the day ticker changes months. The debounce is probably a premature
     * optimisation but at the time it was felt that  removing the data from the
     * timeline on every day tick was a was of resources.
     *
     * @author Oliver Lillie
     */
    clearExpiredTimeline() {
        let clearBeforeIndex = null;
        this.state.timeline.some((flares, index) => {
            if(new Date(flares[0].date) < this.state.activeDate) {
                return false;
            }
            clearBeforeIndex = index;
            return true;
        });

        if(clearBeforeIndex !== null) {
            this.setState({
                timeline: this.state.timeline.slice(clearBeforeIndex),
            });
        }
    }

    /**
     * This boots of the day ticker count down.
     *
     * @author Oliver Lillie
     */
    startYearCount() {
        this.removeWindowClickStartCountUpEvent();

        const intervalId = setInterval(() => {
            this.state.activeDate.setDate(this.state.activeDate.getDate() + 1);

            if(this.state.lastMonth !== this.state.activeDate.getMonth()) {
                this.clearExpiredTimeline();
            }

            const upcomingFlareIds = this.getUpcomingFlareIds();

            this.props.onDayTick(upcomingFlareIds.length > 0);

            this.setState({
                activeDate: this.state.activeDate,
                activeSpots: upcomingFlareIds,
                lastMonth: this.state.activeDate.getMonth()
            });

            if(this.state.activeDate > new Date()) {
                clearInterval(this.state.intervalId);
            } else {
                this.loadNextYearIfRequired();
            }

        }, 500);

        this.setState({
            countUpStarted: true,
            intervalId
        });
    }

    /**
     * We did have audio. now we don't. it was annoying. but left it just in
     * case.
     *
     * @author Oliver Lillie
     */
    playAudio(classType) {
        const audio = new Audio();
        audio.src = explosions[classType];
        audio.play().then().catch();
    }

    /**
     * Keeps track of what is the most commonly occuring flare.
     *
     * @author Oliver Lillie
     * @param {Object} flare
     */
    updateMostCommonFlareType(flare) {
        const flareClassTypes = this.state.flareClassTypes;

        if(typeof flareClassTypes[flare.classType] === 'undefined') {
            flareClassTypes[flare.classType] = {
                count: 0,
                lastOccurred: null
            };
        }
        flareClassTypes[flare.classType].count++;
        flareClassTypes[flare.classType].lastOccurred = flare.date;

        const mostCommonFlareClassType = Object.keys(flareClassTypes).reduce((a, b) => flareClassTypes[a].count > flareClassTypes[b].count ? a : b);

        this.setState({
            flareClassTypes,
            mostCommonFlareType: {
                classType: mostCommonFlareClassType,
                lastOccurred: flareClassTypes[mostCommonFlareClassType].lastOccurred,
                count: flareClassTypes[mostCommonFlareClassType].count,
            },
        });
    }

    /**
     * Keeps track of what is the most active region for flares.
     *
     * @author Oliver Lillie
     * @param {Object} flare
     */
    updateMostActiveRegions(flare) {
        const regions = this.state.regions;

        if(typeof regions[flare.activeRegionNum] === 'undefined') {
            regions[flare.activeRegionNum] = {
                count: 0,
                lastOccurred: null
            };
        }
        regions[flare.activeRegionNum].count++;
        regions[flare.activeRegionNum].lastOccurred = flare.date;

        const mostActiveRegionNum = Object.keys(regions).reduce((a, b) => regions[a].count > regions[b].count ? a : b);

        this.setState({
            regions,
            mostActiveRegion: {
                region: mostActiveRegionNum,
                lastOccurred: regions[mostActiveRegionNum].lastOccurred,
                count: regions[mostActiveRegionNum].count,
            },
        });
    }

    /**
     * Handles the explosion of the flare/spot and updates the related
     * information about the flare.
     *
     * @author Oliver Lillie
     * @param {Node} target
     * @param {Object} flare
     */
    handleBangBang(target, flare) {
        this.updateMostCommonFlareType(flare);
        this.updateMostActiveRegions(flare);
        this.startExplosionFromSpot(target, flare);
    }

    /**
     * Returns a sequence of promises and state setting to get the canvas 2d
     * context to be returned to the Explosion instances.
     *
     * @author Oliver Lillie
     * @return {Promise<any>}
     */
    getCanvasContext() {
        return new Promise((resolve) => {
            if(this.state.animationStarted === false) {
                this.setState({
                    animationStarted: true,
                }, () => {
                    this.setCanvasContext().then(
                        (canvasContext) => {
                            resolve(canvasContext);
                        }
                    );
                });
            } else {
                resolve(this.state.canvasContext);
            }
        });
    }

    /**
     * Sets the canvas context into the components state and updates the window
     * dimensions.
     *
     * @author Oliver Lillie
     * @return {Promise<any>}
     */
    setCanvasContext() {
        return new Promise((resolve) => {
            const canvasContext = this.canvas.current.getContext('2d');
            canvasContext.strokeStyle = "#fff";

            this.setState({
                canvasContext
            }, () => {
                resolve(canvasContext)
            });

            this.updateCanvasSizeToWindowDimensions();
            this.removeWindowResizeEventListener();
            this.setState({
                windowResize: window.addEventListener('resize', this.updateCanvasSizeToWindowDimensions)
            });
        });
    }

    /**
     * Updates the canvases dimensions according to the window size to ensure
     * that the explosions are correctly scaled. That cannot be done with css.
     *
     * @author Oliver Lillie
     */
    updateCanvasSizeToWindowDimensions() {
        if(this.canvas && this.canvas.current) {
            this.canvas.current.width = window.innerWidth;
            this.canvas.current.height = window.innerHeight;
        }
    }

    /**
     * Draw the explosions then check and remove empty explosions and once they
     * have all been removed then the animation can be cancelled.
     *
     * @author Oliver Lillie
     */
    drawExplosions() {
        this.setState({
            animationRequestId: window.requestAnimationFrame(this.drawExplosions.bind(this))
        });

        const canvasContext = this.state.canvasContext;
        canvasContext.clearRect(0, 0, window.innerWidth, window.innerHeight);
        canvasContext.globalCompositeOperation = 'lighter';
        this.setState({ canvasContext });

        this.explosions.forEach((explosion) => {
            explosion.update();
            explosion.draw();
        });

        this.explosions.forEach((explosion, index) => {
            if(explosion.isEmpty() === true) {
                this.explosions.splice(index, 1);
            }
        });
        if(this.explosions.length === 0) {
            this.setState({
                animationStarted: false
            });
            window.cancelAnimationFrame(this.state.animationRequestId);
        }
    }

    /**
     * Creates an explosion instance at the given target location for the given
     * flare and sizes the explosion according to the flare size. The sizing
     * isn't really relative like the flares class types are since it's just
     * a fun ui and not scientific.
     *
     * @author Oliver Lillie
     * @param {Node} target
     * @param {Object} flare
     */
    startExplosionFromSpot(target, flare) {
        let particleCount = 50;
        let decay = 0.9;
        let spring = 2;
        let friction = 0.2;
        let size = 100;
        // eslint-disable-next-line
        switch(flare.classType) {
            case 'X' :
                particleCount = 200;
                // friction = -1.3;
                size = 150;
                break;
            case 'M' :
                particleCount = 125;
                // friction = 0;
                size = 100;
                break;
            case 'C' :
                particleCount = 50;
                // friction = 0.3;
                size = 30;
                break;
            case 'B' :
                particleCount = 25;
                // friction = 0.7;
                size = 10;
                break;
            case 'A' :
                particleCount = 5;
                // friction = 0.8;
                size = 5;
                break;
        }

        const x = target.parentNode.offsetLeft + target.offsetLeft + 60;
        const y = target.parentNode.offsetTop + target.offsetTop + 25;

        this.getCanvasContext().then((canvasContext) => {
            this.addExplosion({
                classType: flare.classType,
                x:x,
                y:y,
                particleCount,
                size,
                decay,
                spring,
                friction,
                canvasContext,
            });
        })
    }

    /**
     * Adds the explosion to the explosions list and requests that the
     * animations for it start.
     *
     * @author Oliver Lillie
     * @param options
     */
    addExplosion(options) {
        this.explosions.push(
            new Explosion(options)
        );
        this.drawExplosions();
        this.playAudio(options.classType);
    }

    /**
     * Returns the canvas node for the explosions. It is only in the dom when
     * there are explosions actually requested and not there all the time.
     *
     * Not actually sure what is more performant, the constant remova/re-add or
     * jsut leaving it in there permenatly.
     *
     * @author Oliver Lillie
     * @return {*}
     */
    getDerivedCanvas() {
        if(this.state.animationStarted === false) {
            return;
        }

        return (
            <canvas ref={this.canvas} className="explosion-canvas" />
        );
    }

    /**
     * Returns the currently active date.
     *
     * @author Oliver Lillie
     * @return {Node}
     */
    getDerivedActiveDate() {
        if(!this.state.countUpStarted) {
            return (
                <div className="date">Click on the window to start.</div>
            );
        }

        const date = this.state.activeDate.toISOString().split('T')[0];
        if(date.split('-').shift() < this.props.startingYear) {
            return null;
        }

        return (
            <div className="date">{date}</div>
        );
    }

    /**
     * Returns the information about the most common type of flare that has been
     * seen.
     *
     * @author Oliver Lillie
     * @return {*}
     */
    getDerivedMostCommonFlare() {
        if(!this.state.mostCommonFlareType) {
            return;
        }

        return (
            <p className="info--most-common">
                The most common type of flare is a class {this.state.mostCommonFlareType.classType} and has occurred {this.state.mostCommonFlareType.count} times. Last occured on {this.state.mostCommonFlareType.lastOccurred}.
            </p>
        );
    }

    /**
     * Returns the information about the most active region for flares in the
     * sun.
     *
     * @author Oliver Lillie
     * @return {*}
     */
    getDerivedMostActiveRegion() {
        if(!this.state.mostActiveRegion) {
            return;
        }

        return (
            <p className="info--most-acive-region">
                The most active region is {this.state.mostActiveRegion.region} having been the source of {this.state.mostActiveRegion.count} flares.
            </p>
        );
    }

    render() {
        return (<>
            <div className="side-spot--wrapper">
                <div className="side-spot--inner">
                    {/*This probably isn't the most performant way to output the*/}
                    {/*spots but it was when I was going down a different route*/}
                    {/*if this were a live project this would have been refactored*/}
                    {this.getDerivedXClassSpots()}
                    {this.getDerivedMClassSpots()}
                    {this.getDerivedCClassSpots()}
                    {this.getDerivedBClassSpots()}
                    {this.getDerivedAClassSpots()}
                </div>
            </div>
            {this.getDerivedActiveDate()}
            <div className="info">
                {this.getDerivedMostCommonFlare()}
                {this.getDerivedMostActiveRegion()}
            </div>
            {this.getDerivedCanvas()}
        </>);
    }
}

